import React from 'react';
import ReactDOM, { render} from 'react-dom';
import './Style.css'
import TopBar from './components/TopBar';
import LoginPage from './components/loginPage';

ReactDOM.render(
    <react>
        <TopBar>
            Accueil
        </TopBar>
    </react>,
    document.getElementById('root')
);
ReactDOM.render(
    <react>
        <LoginPage>
        </LoginPage>
    </react>,
    document.getElementById('root')
);
